text:
Replying to @rssurjewala रणदीप सुरजेवाला पहले आपके पापा और अब आप गांधी परिवार के पप्पू की चाटुकारिता करने में क्यों लगे हो। क्या यह बंधुआ मजदूर नहीं?
@rssurjewala
@RahulGandhi Quote TweetRandeep Singh Surjewala@rssurjewala · Jun 1, 2019पहले भाजपा सांसद प्रज्ञा ठाकुर, फिर भाजपा विधायक ऊषा ठाकुर और अब महाराष्ट्र से IAS अधिकारी निधी चौधरी ने गांधीजी के हत्यारे नाथूराम गोडसे की प्रशंसा की है।

CM फडणवीस को तत्काल,निधी चौधरी पर कार्यवाही करनी होगी। 

बापू की 150वीं जयंती पर भाजपा गोडसे का महिमामंडन क्यों कर रही है?

